I'm implementing Google Analytics / GTM / other tracking services, but want to make sure the user has DoNotTrack and [GPC](https://global-privacy-control.glitch.me) disabled. I know I could just add this JS snippet for each document or combine each script into the if statement, but I want to know if this is possible nonetheless. Here's a code snippet showing what I want to do:

```js
if (isDoNotTrackEnabled() == false || navigator.globalPrivacyControl == true) {
 {% include gtag.html %}
 {% include gtm.html %}
}
```

Edit: What I was asking was if including HTML files in JS would exit the JS and embed the HTML.  
I've used `.js` includes now, by simply using a single file for gtag/gtm. I was initially under the impression that you needed to include HTML instead of converting it into a single-file JS file (there's a part in `<head>` and another in `<body>`.
